import React from 'react'
import './Material.css'

const Material = ({ material }) => {
    return (
        <div className='materialbox'>
            <p className='titlebox'>{material.Title}</p>
            <p>{material.Description}</p>
        </div>
    )
}

const Detailed = ({ material }) => {
    return (
        <div>
            <p>{material.Title}</p>
            <p>{material.Description}</p>
            <p>{material.Usage}</p>
            <p>{material.ThermalConductivity}</p>
            <p>{material.buildings}</p>
        </div>
    )
}

